import React from "react";
import {
  AiFillGithub,
  AiOutlineHtml5,
  AiOutlineCss3,
  AiOutlineNodeIndex,
} from "react-icons/ai";

const skills = [
  {
    name: "React",
    image:
      "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/react/react-original.svg",
  },
  {
    name: "Node.js",
    image:
      "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/nodejs/nodejs-original.svg",
    icon: <AiOutlineNodeIndex size={48} />,
  },
  {
    name: "MongoDB",
    image:
      "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/mongodb/mongodb-original.svg",
  },
  {
    name: "Express",
    image:
      "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/express/express-original.svg",
  },
  {
    name: "Tailwind CSS",
    image:
      "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/tailwindcss/tailwindcss-plain.svg",
  },
  {
    name: "Git",
    image:
      "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/git/git-original.svg",
    icon: <AiFillGithub size={48} />,
  },
  {
    name: "Docker",
    image:
      "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/docker/docker-original.svg",
  },
  {
    name: "Kubernetes",
    image:
      "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/kubernetes/kubernetes-plain.svg",
  },
  // Add React Icons as skill items
  {
    name: "HTML5",
    icon: <AiOutlineHtml5 size={48} />,
  },
  {
    name: "CSS3",
    icon: <AiOutlineCss3 size={48} />,
  },
];

const SkillsSection = () => {
  return (
    <section className="bg-gray-900 text-white py-12">
      <div className="container mx-auto px-6">
        <h2 className="text-3xl font-bold text-center mb-8">Skills</h2>
        <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 gap-6">
          {skills.map((skill, index) => (
            <div
              key={index}
              className="flex flex-col items-center p-4 bg-gray-800 rounded-lg shadow-md hover:shadow-lg transition-shadow"
            >
              {/* Render image if exists, otherwise render React Icon */}
              {skill.image ? (
                <img
                  src={skill.image}
                  alt={skill.name}
                  className="w-16 h-16 mb-4"
                />
              ) : (
                <div className="mb-4">{skill.icon}</div>
              )}
              <h3 className="text-lg font-medium">{skill.name}</h3>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default SkillsSection;
